  /// Enable or disable loading templates from disk
  /// When enabled, templates will be loaded from the file system
  /// and fall back to bundled templates if not found
  void setLoadFromDisk(bool loadFromDisk, {String? templatesPath}) {
    _loadFromDisk = loadFromDisk;
    if (templatesPath != null) {
      _diskTemplatesPath = templatesPath;
    }
    if (!loadFromDisk) {
      _diskCache.clear(); // Clear cache when switching back to bundle
    }
  }

  /// Get current disk loading configuration
  bool get isLoadingFromDisk => _loadFromDisk;

  /// Get current disk templates path
  String get diskTemplatesPath => _diskTemplatesPath;

  /// Clear the disk template cache
  void clearDiskCache() {
    _diskCache.clear();
  }

  /// Load template bytes from disk
  Future<Uint8List?> _loadFromDiskBytes(String path) async {
    if (!_loadFromDisk) return null;

    // Check cache first
    if (_diskCache.containsKey(path)) {
      return _diskCache[path];
    }

    try {
      final file = File('$_diskTemplatesPath/$path');
      if (await file.exists()) {
        final bytes = await file.readAsBytes();
        _diskCache[path] = bytes; // Cache the result
        return bytes;
      }
    } catch (e) {
      // Silently fall back to bundle on any disk error
    }

    return null;
  }

  /// Get template bytes by path
  /// Returns null if the template is not found
  Future<Uint8List?> getTemplateBytes(String path) async {
    // Try disk first if enabled
    if (_loadFromDisk) {
      final diskBytes = await _loadFromDiskBytes(path);
      if (diskBytes != null) return diskBytes;
    }

    // Fall back to bundle
    final bytes = _templateBytes[path];
    return bytes != null ? Uint8List.fromList(bytes) : null;
  }

  /// Get template bytes by path, throws if not found
  Future<Uint8List> getRequiredTemplateBytes(String path) async {
    final bytes = await getTemplateBytes(path);
    if (bytes == null) {
      throw ArgumentError('Template not found: $path');
    }
    return bytes;
  }

  /// Get template bytes by path (bundle only, synchronous)
  /// Returns null if the template is not found
  Uint8List? getTemplateBytesSync(String path) {
    final bytes = _templateBytes[path];
    return bytes != null ? Uint8List.fromList(bytes) : null;
  }

  /// Get template bytes by path (bundle only, synchronous), throws if not found
  Uint8List getRequiredTemplateBytesSync(String path) {
    final bytes = _templateBytes[path];
    if (bytes == null) {
      throw ArgumentError('Template not found: $path');
    }
    return Uint8List.fromList(bytes);
  }

  /// Get template as string by path
  /// Returns null if the template is not found
  Future<String?> getTemplate(String path) async {
    final bytes = await getTemplateBytes(path);
    return bytes != null ? utf8.decode(bytes) : null;
  }

  /// Get template as string by path, throws if not found
  Future<String> getRequiredTemplate(String path) async {
    final bytes = await getRequiredTemplateBytes(path);
    return utf8.decode(bytes);
  }

  /// Get template as string by path (bundle only, synchronous)
  /// Returns null if the template is not found
  String? getTemplateSync(String path) {
    final bytes = getTemplateBytesSync(path);
    return bytes != null ? utf8.decode(bytes) : null;
  }

  /// Get template as string by path (bundle only, synchronous), throws if not found
  String getRequiredTemplateSync(String path) {
    final bytes = getRequiredTemplateBytesSync(path);
    return utf8.decode(bytes);
  }

  /// Get all available template paths (bundle only)
  List<String> get availableTemplates => _templateBytes.keys.toList();

  /// Check if a template exists (checks disk if enabled, then bundle)
  Future<bool> hasTemplate(String path) async {
    if (_loadFromDisk) {
      try {
        final file = File('$_diskTemplatesPath/$path');
        if (await file.exists()) return true;
      } catch (e) {
        // Fall through to bundle check
      }
    }
    return _templateBytes.containsKey(path);
  }

  /// Check if a template exists (bundle only, synchronous)
  bool hasTemplateSync(String path) => _templateBytes.containsKey(path);

  /// Get the size in bytes of a template
  Future<int?> getTemplateSize(String path) async {
    final bytes = await getTemplateBytes(path);
    return bytes?.length;
  }

  /// Get the size in bytes of a template (bundle only, synchronous)
  int? getTemplateSizeSync(String path) {
    final bytes = _templateBytes[path];
    return bytes?.length;
  }

  /// Get total size of all bundled templates in bytes
  int get totalSize {
    return _templateBytes.values.fold<int>(
      0,
      (sum, bytes) => sum + bytes.length,
    );
  }

